import React from 'react';
import './App.css';
import Button from './components/Button';
import logo from './5.jpg'

function App() {
  return (
    <div className="App">
      <div className="hero">
        <img src={logo} alt="Image" />
      </div>
      <div className="text">
        <h1>Kazool App</h1>
        <p>Get the kazool app and get up-to-date images on device. Available for all devices</p>
        <Button />
      </div>
    </div>
  );
}

export default App;
